INSERT INTO `author` VALUES (1,'Stephen Hawking','img/author/Stephen Hawking.jpg','Stephen Hawking was a British scientist, professor and author who performed groundbreaking work in physics and cosmology, and whose books helped to make science accessible to everyone.','2019-12-19 08:45:47','2019-12-18 07:13:50'),(2,'Lisa Wingate\r\n','img/author/Lisa Wingate.jpg','Lisa Wingate is a former journalist, an inspirational speaker, and the bestselling author of more than thirty books. Her blockbuster \"Before We Were Yours\" was on the NYT best seller list for over one year.','2019-12-19 08:46:06','2019-12-18 07:27:44'),(3,'Elliot Ackerman\r\n','img/author/Elliot Ackerman.jpg','ELLIOT ACKERMAN is the author of the novels Red Dress In Black and White, Waiting for Eden, Dark at the Crossing, and Green on Blue, as well as the memoir Places and Names: On War, Revolution and Returning','2019-12-19 08:46:32','2019-12-18 07:33:26'),(4,'Anne Frank','img/author/Anne Frank.jpg',' “Anne” Frank was a world-famous German-born diarist and World War II Holocaust victim. Her work, The Diary of Anne Frank, has been read by millions. Fleeing Nazi persecution of Jews, the family moved to Amsterdam and later went into hiding for two years.','2019-12-19 08:46:56','2019-12-18 07:36:36'),(5,'Danielle Steel\r\n','img/author/Danielle Steel.jpg','Danielle Steel, in full Danielle Fernande Schuelein-Steel, (born August 14, 1947, New York City, New York, U.S.), American writer best known for her numerous best-selling romance novels. Steel was an only child. After her parents divorced, she was reared by relatives and family employees in Paris and New York City.','2019-12-19 08:47:18','2019-12-18 07:40:36'),(6,'Heather Morris\r\n','img/author/Heather Morris.jpg','Heather Morris. Share This Author: Heather Morris is a native of New Zealand, now resident in Australia. For several years, while working in a large public hospital in Melbourne, she studied and wrote screenplays, one of which was optioned by an Academy Award-winning screenwriter in the US.','2019-12-19 08:47:35','2019-12-18 07:52:47'),(7,'Dan Brown','img/author/Dan Brown.jpg','Dan Brown, (born June 22, 1964, Exeter, New Hampshire, U.S.), American author who wrote well-researched novels that centred on secret organizations and had intricate plots. He was best known for the Robert Langdon series,','2019-12-19 08:47:54','2019-12-18 08:20:58'),(8,'Margaret Mitchell','img/author/Margaret Mitchell.jpg','Margaret Mitchell was an American novelist. After a broken ankle immobilized her in 1926, Mitchell started writing a novel that would become Gone With the Wind. Published in 1936, Gone With the Wind made Mitchell an instant celebrity and earned her the Pulitzer Prize','2019-12-19 08:48:06','2019-12-18 08:32:56'),(9,'Harry Harrison','img/author/Harry Harrison.jpg','Harry Max Harrison (born Henry Maxwell Dempsey; March 12, 1925 – August 15, 2012) was an American science fiction author, known, among other, for his character The Stainless Steel Rat and for his novel Make Room! Make Room! (1966). The latter was the rough basis for the motion picture Soylent Green (1973)','2019-12-19 08:48:33','2019-12-18 08:43:13'),(10,'victor hugo ','img/author/Victor Hugo.jpg','Victor Marie Hugo (French: [viktɔʁ maʁi yɡo] ( listen); 26 February 1802 – 22 May 1885) was a French poet, novelist, and dramatist of the Romantic movement. Hugo is considered to be one of the greatest and best-known French writers.','2019-12-19 08:48:46','2019-12-18 08:43:48');
