INSERT INTO `book` VALUES (1,'A Brief History of Time','A landmark volume in science writing by one of the great minds of our time, Stephen Hawking’s book explores such profound questions as: How did the universe begin—and what made its start possible? Does time always flow forward? Is the universe unending—or are there boundaries? Are there other dimensions in space? What will happen when it all ends?\r\n\r\nTold in language we all can understand, A Brief History of Time plunges into the exotic realms of black holes and quarks, of antimatter and “arrows of time,” of the big bang and a bigger God—where the possibilities are wondrous and unexpected. With exciting images and profound imagination, Stephen Hawking brings us closer to the ultimate secrets at the very heart of creation.',1998,212,21.51,0,5,2,2,'books/A Brief History of time.jpg','2019-12-19 09:23:07','2019-12-18 07:24:54',1,12),(2,'Before We Were Yours','Based on one of America’s most notorious real-life scandals—in which Georgia Tann, director of a Memphis-based adoption organization, kidnapped and sold poor children to wealthy families all over the country—Lisa Wingate’s riveting, wrenching, and ultimately uplifting tale reminds us how, even though the paths we take can lead to many places, the heart never forgets where we belong.',2018,480,10.00,0,6,2,6,'books/Before We Were Yours.jpg','2019-12-19 08:51:47','2019-12-18 07:30:28',2,2),(3,'Waiting for Eden: A Novel','den Malcom lies in a bed, unable to move or to speak, imprisoned in his own mind. His wife Mary spends every day on the sofa in his hospital room. He has never even met their young daughter. And he will never again see the friend and fellow soldier who didn’t make it back home–and who narrates the novel. But on Christmas, the one day Mary is not at his bedside, Eden’s re-ordered consciousness comes flickering alive. As he begins to find a way to communicate, some troubling truths about his marriage–and about his life before he went to war–come to the surface. Is Eden the same man he once was: a husband, a friend, a father-to-be? What makes a life worth living? A piercingly insightful, deeply felt meditation on loyalty and betrayal, love and fear, Waiting for Eden is a tour de force of profound humanity.',2018,192,13.87,0,9,2,7,'books/Waiting for Eden A novel.jpg','2019-12-19 08:53:08','2019-12-18 07:35:01',3,8),(4,'The Diary of a Young Girl','In 1942, with the Nazis occupying Holland, a thirteen-year-old Jewish girl and her family fled their home in Amsterdam and went into hiding. For the next two years, until their whereabouts were betrayed to the Gestapo, the Franks and another family lived cloistered in the “Secret Annexe” of an old office building. Cut off from the outside world, they faced hunger, boredom, the constant cruelties of living in confined quarters, and the ever-present threat of discovery and death. In her diary Anne Frank recorded vivid impressions of her experiences during this period. By turns thoughtful, moving, and surprisingly humorous, her account offers a fascinating commentary on human courage and frailty and a compelling self-portrait of a sensitive and spirited young woman whose promise was tragically cut short.',1993,238,12.00,3,7,8,6,'books/The Diary of a Young Girl.jpg','2019-12-19 08:53:35','2019-12-18 07:38:20',4,2),(5,'Blessing in Disguise: A Novel','As a young intern at an art gallery in Paris, Isabelle McAvoy meets Putnam Armstrong, wealthy, gentle, older, and secluded from the world. Isabelle’s relationship with Putnam, and her time at his château on the Normandy coast, are the stuff of dreams. But it turns real when she becomes pregnant, for she knows that marriage is out of the question.',1994,256,13.91,0,8,2,2,'books/Blessing in Disguise A Novel.jpg','2019-12-19 08:53:48','2019-12-18 07:43:21',5,2),(6,'Lost and Found: A Novel','It all starts with a fall from a ladder, in a firehouse in New York City. The firehouse has been converted into a unique Manhattan home and studio where renowned photographer Madison Allen works and lives after raising three children on her own. But the accident, which happens while Maddie is sorting through long-forgotten personal mementos and photos, results in more than a broken ankle. It changes her life.',2019,359,22.00,15,12,2,2,'books/Lost and Found A Novel.jpg','2019-12-19 08:54:03','2019-12-18 07:47:35',5,2),(7,'Silent Night: A Novel','Paige Watts is the ultimate stage mother. The daughter of Hollywood royalty, Paige channels her acting dreams into making her own daughter, Emma, a star. By the age of nine, Emma is playing a central role in a hit TV show. Then everything is shattered by unforeseeable tragedy.\r\n\r\nNow Emma is living with her aunt Whitney, who had chosen a very different path from her sister’s. Whitney was always the studious older sister, hating the cult of celebrity that enveloped their childhood. Instead, she is a psychiatrist who lives for her work and enjoys a no-strings-attached love affair with a wealthy venture capitalist. But at a moment’s notice, Whitney drops everything to help her niece.',2019,270,31.00,0,21,2,2,'books/Silent Night A Novel.jpg','2019-12-19 08:54:20','2019-12-18 07:49:22',5,2),(8,'Spy: A Novel','At eighteen, Alexandra Wickham is presented to King George V and Queen Mary in an exquisite white lace and satin dress her mother has ordered from Paris. With her delicate blond looks, she is a stunning beauty who seems destined for a privileged life. But fate, a world war, and her own quietly rebellious personality lead her down a different path.',2007,264,30.00,23,21,2,2,'books/Spy A Novel.jpg','2019-12-19 08:54:41','2019-12-18 07:50:45',5,2),(9,'Brief Answers to the Big Questions','Brief Answers to the Big Questions is a popular-science book written by physicist Stephen Hawking, and published by Hodder & Stoughton (Hardcover) and Bantam Books (Paperback) on 16 October 2018. The book examines some of the universe\'s greatest mysteries, and promotes the view that science is very important in helping to solve problems on planet Earth.',2018,256,32.00,0,12,2,2,'books/Brief Answers to the Big Questions.jpg','2019-12-19 08:55:01','2019-12-18 07:57:20',1,12),(10,'The Grand Design','he Grand Design is a popular-science book written by physicists Stephen Hawking and Leonard Mlodinow and published by Bantam Books in 2010. The book examines the history of scientific knowledge about the universe and explains 11 dimension M-theory. The authors of the book point out that a Unified Field Theory (a theory, based on an early model of the universe, proposed by Albert Einstein and other physicists) may not exist.',2010,208,23.99,0,20,2,2,'books/The Grand Design.jpg','2019-12-19 08:55:14','2019-12-18 07:59:25',8,12),(11,'The Universe in a Nutshell','The Universe in a Nutshell is a 2001 book about theoretical physics by Stephen Hawking. It is generally considered a sequel and was created to update the public concerning developments since the multi-million-copy bestseller A Brief History of Time published in 1988.',2001,224,23.45,0,21,2,1,'books/The Universe in a Nutshell.jpg','2019-12-19 08:55:29','2019-12-18 08:00:37',9,12),(12,'Black Holes and Baby Universes and Other Essays','Black Holes and Baby Universes and other Essays is a 1993 popular science book by English astrophysicist Stephen Hawking',1993,183,21.67,0,8,2,1,'books/Black Holes and Baby Universes and Other Essays.jpg','2019-12-19 08:55:40','2019-12-18 08:01:59',1,12),(13,'God Created the Integers','God Created the Integers: The Mathematical Breakthroughs That Changed History is an anthology, edited by Stephen Hawking, of \"excerpts from thirty-one of the most important works in the history of mathematics',2005,1176,39.21,0,12,2,4,'books/God Created the Integers.jpg','2019-12-19 08:55:58','2019-12-18 08:11:48',1,12),(14,'Amazing Grace','Amazing Grace is a novel by Danielle Steel, published by Delacorte Press in October 2007. The book is Steel\'s seventy-third novel',2007,336,11.21,0,8,4,1,'books/Amazing Grace.jpg','2019-12-19 08:56:08','2019-12-18 08:14:20',5,4),(15,'The Duchess','Angélique Latham has grown up at magnificent Belgrave Castle under the loving tutelage of her father, the Duke of Westerfield, after the death of her aristocratic French mother. At eighteen she is her father\'s closest, most trusted child, schooled in managing their grand estate. But when he dies, her half-brothers brutally turn her out, denying her very existence. Angélique has a keen mind, remarkable beauty, and an envelope of money her father pressed upon her. To survive, she will need all her resources--and one bold stroke of fortune.\r\n',2017,452,23.00,0,21,3,8,'books/The Duchess.jpg','2019-12-19 08:56:21','2019-12-18 08:15:40',5,7),(16,'The Mistress','incomparable storyteller Danielle Steel illuminates rarely glimpsed precincts of unimaginable wealth and power, where love and freedom are the most dangerous desires of all.',2017,235,39.99,0,25,2,7,'books/The Mistress.jpg','2019-12-19 08:56:32','2019-12-18 08:16:45',5,6),(17,'His Bright Light','From the day he was born, Nick Traina was his mother\'s joy. By nineteen, he was dead. This is Danielle Steel\'s powerful, personal story of the son she lost and the lessons she learned during his courageous battle against darkness.',1998,256,25.99,0,7,2,4,'books/His Bright Light.jpg','2019-12-19 08:56:51','2019-12-18 08:18:10',5,4),(18,'Fairytale','NEW YORK TIMES BESTSELLER • A wonderful, beautifully told tale from America’s favorite novelist, Fairytale is a captivating example of the truths that will always withstand even the darkest storms',2007,234,39.00,0,8,2,4,'books/Fairytale.jpg','2019-12-19 08:57:06','2019-12-18 08:20:01',5,4),(19,'The Da Vinci Code','Symbologist Robert Langdon travels from Paris to London to discover the truth behind a mysterious and bizarre murder. Later, he learns about a religious mystery protected by a secret society.',2003,583,49.00,0,15,2,6,'books/The Da Vinci Code.jpg','2019-12-19 08:57:24','2019-12-18 08:22:49',7,8),(20,'Angels & Demons','Robert, a symbologist, tries his best to stop a secret society from destroying Vatican City. He tries to decipher various clues in the process, most of which lead him to the four altars of science.',2009,576,49.99,0,12,2,5,'books/Angels n Demons.jpg','2019-12-19 08:57:35','2019-12-18 08:23:58',7,8),(21,'Inferno','After waking up with amnesia in a hospital, Robert Langdon teams up with Sienna Brooks, one of his doctors, to protect the world from the evil plan of a mad scientist.',2016,384,29.89,0,18,2,7,'books/Inferno.jpg','2019-12-19 08:57:48','2019-12-18 08:25:42',7,8),(22,'The Lost Symbol','he Lost Symbol is a 2009 novel written by American writer Dan Brown. It is a thriller set in Washington, D.C., after the events of The Da Vinci Code, and relies on Freemasonry for both its recurring theme and its major characters',2009,671,38.56,30.25,21,2,8,'books/The Lost Symbol.jpg','2019-12-19 08:57:58','2019-12-18 08:27:49',7,8),(23,'Origin','Origin is a 2017 mystery thriller novel by American author Dan Brown and the fifth installment in his Robert Langdon series, following Inferno. The book was released on October 3, 2017 by Doubleday. The book is predominantly set in Spain and features minor sections in Dubai and Budapest.',2017,357,43.99,32.23,12,2,7,'books/Origin.jpg','2019-12-19 08:58:11','2019-12-18 08:29:02',7,8),(24,'Deception point','Deception Point is a 2001 mystery-thriller novel by American author Dan Brown. It is Brown\'s third novel and, as of 2019, his second and latest outside of the Robert Langdon series. It was published by Simon & Schuster',2001,580,59.99,37.21,18,2,7,'books/Deception point.jpg','2019-12-19 08:58:22','2019-12-18 08:30:21',7,8),(25,'Digital Fortress','Digital Fortress is a techno-thriller novel written by American author Dan Brown and published in 1998 by St. Martin\'s Press',1998,323,39.99,21,7,5,5,'books/Digital Fortress.jpg','2019-12-19 08:58:36','2019-12-18 08:31:35',7,4),(26,'gone with the wind','Gone with the Wind is a novel by American writer Margaret Mitchell, first published in 1936. The story is set in Clayton County and Atlanta, both in Georgia, during the American Civil War and Reconstruction Era',1936,1024,67.00,54,21,5,2,'books/gone with the wind.jpg','2019-12-19 08:58:58','2019-12-18 08:35:09',8,5),(27,'Lost Laysen','Lost Laysen is a novella by Margaret Mitchell. Although it was written in 1916, it was not published until 1996. Mitchell, who is best known as the author of Gone with the Wind, was believed to have only written one full book during her lifetime',1996,452,49.99,37.21,18,2,5,'books/Lost Laysen.jpg','2019-12-19 08:59:10','2019-12-18 08:36:48',8,6),(28,'Before Scarlett','On a sultry summer morning, Jane Eskridge and Wailes Thomas, a relative of Margaret Mitchell\'s, are knee-deep in over sixty years worth of accumulated detritus in the Atlanta home Thomas had inherited from his mother; and they made a discovery: 200 pages of short stories, fairy tales, journal entries, essays, and one-act plays by Margaret Mitchell, penned from ages eight through seventeen. Since her early death at age 49 (hit by a car while crossing the street), all of Mitchell\'s personal papers and other writings are thought to have been destroyed. Then, several years ago, a lone novella, Lost Laysen, was discovered and published',2000,214,42.99,32.25,27,2,6,'books/Before Scarlett.jpg','2019-12-19 08:59:32','2019-12-18 08:37:58',8,4),(29,'Return to Eden','Return To Eden is a 1988 science fiction novel by American writer Harry Harrison.\r\n\r\nThe novel is the third and final volume in Harrison\'s Eden. The first two stories of the trilogy are West of Eden and Winter in Eden.\r\n\r\nThe novel tells an alternate history of planet Earth in which the extinction of the dinosaurs never occurred. There is a war between a group of Cro-Magnon-level humans, who are descended from New World monkeys, and a reptilian race called the Yilanè, who are descended from the prehistoric mosasaur and have become the dominant lifeform on the planet.',1988,296,45.29,34,31,2,4,'books/Return to Eden.jpg','2019-12-19 08:59:45','2019-12-18 08:40:14',9,2),(30,'The Man Who Laughs','The Man Who Laughs is a novel by Victor Hugo, originally published in April 1869 under the French title L\'Homme qui rit. It is \"a dark novel about royal and aristocratic despotism\", but Hugo intended parallels between the England depicted and the France of Louis-Philippe and the Régence',1987,386,34.99,0,18,8,6,'books/The Man Who Laughs.jpg','2019-12-19 08:59:56','2019-12-18 08:41:49',10,2);
